import React, { Component } from "react";

class ModalReact extends Component {
    
    test1 = () => {
        console.log("Hello1")
    }

    render() {
        return (
            <button onClick={console.log("Hello1")}> Modal React</button>
        );
    }
}

export default ModalReact;
